import hf from "scripts/helpers"
import TmCardHz from "cards/TmCardHz"
export default {
  name: "cards-events",
  components: {
    TmCardHz
  },
  data: () => ({
    hf: hf
  }),
  methods: {
    subtitle(event) {
      if (event.subtitle) {
        return event.subtitle
      }
      if (event.dateStart && event.dateEnd) {
        let value = `${this.hf.dates(event.dateStart, event.dateEnd)}`
        if (event.type) {
          return `${value} 路 ${event.type}`
        }
        // if (event.location) {
        //   return (value += " 路 " + event.location)
        // }
        return value
      }
      return `TBD 路 ${event.location}`
    }
  },
  props: ["events"]
}
